INSERT INTO `v9_page` VALUES ('25', '联系我们', ';', '', '<span style=\"color: rgb(83, 83, 83); font-family: \'Microsoft YaHei\'; font-size: 14px; line-height: 28px;\">公司法的最近一次修改是在2013年8月30日，《中华人民共和国商标法》修正案经十二届全国人大常委会第四次会议审议并通过，新公司法将自2014年5月1日起施行。这是我国商标法的第三次修改。新公司法修改的内容中是为明显著的内容就是企业的注册资金由实缴制变为了认缴制和&ldquo;三证合一，一照一码&rdquo;政策的确定。</span>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　北京市自2015年9月29日起全面实行&ldquo;一照一码&rdquo;登记，北京市企业、农民专业合作社、外国企业常驻代表机构(含分支机构，以下统称&ldquo;企业&rdquo;)均实行&ldquo;一照一码&rdquo;登记，个体工商户暂不纳入改革范围。&ldquo;一照一码&rdquo;登记制度改革实施后设立过渡期，北京市至2020年12月31日止。</p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">　　三证合一，一照一码的基本原则是怎样的呢?</span></p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　1、兼容并蓄，降低成本。以当前基础较好、应用广泛的组织机构代码为基础，最大限度满足各部门管理需求，降低另建及改造成本，减轻社会负担。[16]</p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　2、统一标准，分步实施。制定统一代码制度建设相关标准，确定代码位数和构成。设立过渡期，实现现有各类机构代码逐步向统一代码过渡。[16]</p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　3、立足当前，着眼长远。以满足需求、便利管理为导向，制定适合当前各部门兼容使用的编码规则，为将来各部门之间信息共享和业务协同打好基础。[16]</p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">三证合一，一照一码的主要特性有哪些?</span></p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">1、唯一性</span></p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　统一代码及其9位主体标识码(组织机构代码)在全国范围内是唯一的。一个主体只能拥有一个统一代码，一个统一代码只能赋予一个主体。主体注销后，该代码将被留存，保留回溯查询功能。例如，一个主体由事业单位改制为企业，按照法定程序，需依法注销该事业单位，再设立新企业。新设立企业是一个新主体，需赋予新的统一代码。</p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">2、兼容性</span></p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　统一代码最大程度地兼容现有各类机构代码，既能体现无含义代码的稳定可靠，又能发挥有含义代码便于分类管理的作用，最大程度地减少改造成本。统一代码在第二、三部分设计了机构类别代码和登记管理机关行政区划码，与工商注册号、事业单位证书号、机构信用代码相应部分含义一致。第四部分主体标识码采用组织机构代码，保证了统一代码与组织机构代码有效衔接。</p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">3、稳定性</span></p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　统一代码一经赋予，在其主体存续期间，主体信息即使发生任何变化，统一代码均保持不变。例如，法人和其他组织迁徙或变更法定代表人、经营范围等，均不改变其统一代码。</p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">4、全覆盖</span></p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　统一代码制度实施后，对新设立的法人和其他组织，在注册登记时发放统一代码;对已设立的法人和其他组织，通过适当方式换发统一代码，实现对法人和其他组织全覆盖</p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　那么对于&ldquo;三证合一，一照一码&rdquo;会产生哪些周边问题呢?今天公司宝小编就来为大家做一下梳理，如有不懂的内容可拨打400-089-0066进行资咨询。</p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">&ldquo;三证合一，一照一码&rdquo;登记的概念</span></p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　&ldquo;三证合一、一照一码&rdquo;(以下简称&ldquo;一照一码&rdquo;)登记是指申请人向工商行政管理、质量技术监督、税务部门分别申请办理营业执照、组织机构代码证、税务登记证，改为通过&ldquo;一表申请、一窗受理&rdquo;的方式向工商行政管理部门申请办理加载统一社会信用代码的营业执照，组织机构代码证和税务登记证不再办理。北京市将统计登记纳入合办范围，取得加载统一社会信用代码营业执照的，不再办理统计登记证。</p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">对于 &ldquo;一照一码&rdquo;登记的修改依据的是什么?</span></p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　《国务院关于批转发展改革委等部门法人和其他组织统一社会信用代码制度建设总体方案的通知》(国发〔2015〕33号)、《国务院办公厅关于加快推进&ldquo;三证合一&rdquo;登记制度改革的意见》(国办发〔2015〕50号)和《工商总局等六部门关于贯彻落实&lt;国务院办公厅关于加快推进&ldquo;三证合一&rdquo;登记制度改革的意见&gt;的通知》(工商企注字[2015]121号)。</p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">&ldquo;三证合一，一照一码&rdquo;实施的时间</span></p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　北京市自2015年9月29日起全面实行&ldquo;一照一码&rdquo;登记。</p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">&ldquo;三证合一，一照一码&rdquo;适用于哪些创业者?</span></p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　北京市企业、农民专业合作社、外国企业常驻代表机构(含分支机构，以下统称&ldquo;企业&rdquo;)均实行&ldquo;一照一码&rdquo;登记。</p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　个体工商户暂不纳入改革范围。个体工商户申请转变为企业组织形式的，可以享受&ldquo;一照一码&rdquo;登记政策。</p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">已登记企业如何换发营业执照?是否有时间限制?</span></p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　&ldquo;一照一码&rdquo;登记实行前登记的企业，可以随变更登记一并换发加载统一社会信用代码的营业执照，也可根据需要单独申请换发营业执照。换发加载统一社会信用代码营业执照的，应当向工商登记机关交回原组织机构代码证、税务登记证、统计登记证。</p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　&ldquo;一照一码&rdquo;登记制度改革实施后设立过渡期，北京市至2020年12月31日止。在过渡期内未换发加载统一社会信用代码营业执照的，原营业执照、组织机构代码证、税务登记证、统计登记证仍然有效，可继续使用，过渡期结束后一律使用加载统一社会信用代码的营业执照办理相关业务，未换发的营业执照不再有效。</p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">如出现遗失或未办理相关证照情况可按以下规则处理</span></p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　1、组织机构代码证、税务登记证遗失的，应当提交法定代表人签字并加盖公章的遗失说明和刊登遗失公告的报纸报样。统计登记证遗失的，应当提交法定代表人签字并加盖公章的遗失说明，无需刊登遗失公告。</p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　2、组织机构代码证、税务登记证、统计登记证未办理的，应当提交法定代表人签字并加盖公章的说明，并对真实性负责。</p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">最关心的问题：换发营业执照是否收费?</span></p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　工商部门在换发营业执照时不收取任何费用。</p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">加载统一社会信用代码的营业执照的使用效力是什么?</span></p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 28px; font-family: \'Microsoft YaHei\'; vertical-align: baseline; color: rgb(83, 83, 83);\">　　加载统一社会信用代码的营业执照代替原营业执照、组织机构代码证、税务登记证、统计登记证的使用功能。企业原需要使用组织机构代码证、税务登记证、统计登记证办理各类相关事务的，一律改为使用加载统一社会信用代码的营业执照办理。</p>\r\n', '', '0');
